import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { library } from '@fortawesome/fontawesome-svg-core';
import { fab } from '@fortawesome/free-brands-svg-icons';

class ATWSection extends React.Component {
  render() {
    const social = this.props.data.social;

    return(
      <div className="ATWSection">
	<p>
	  Popular gadgets come from vendors like:
	</p>
	{ social.map((soc) => 
	  <button className="FAButton">
	    <FontAwesomeIcon icon={['fab', ]} inverse />
	  </button>
	)}
      </div>
    );
  }
}

export default ATWSection;
